import React from 'react';
import { useNavigate } from 'react-router-dom';
import './plateGenerate.css';

const PlateGenerate = () => {
    const history = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        history('/pdf');  // 跳转到 PDF 页面
    };

    const handleReturn = (e) => {
        e.preventDefault();
        history('/login');
    };
    return (
        <div className="plateGenerate-page-base">
            <div className="content-container">
                <section className="plateGenerate-section">
                    <h1 className="plateGenerate-title">澳門車輛入境車牌生成</h1>

                    <div className="plateGenerate-buttons">
                        <input type="text" placeholder="请输入你的澳门车牌" className="plateGenerate-input"/>
                        <form className="plateGenerate-form" onSubmit={handleSubmit}>
                            <button type="submit" className="plateGenerate-button">提交</button>
                            </form>
                        <form className="plateGenerate-form-return" onSubmit={handleReturn}>
                            <button type="return" className="plateGenerate-button">返回主頁</button>
                        </form>
                    </div>

            </section>
        </div>
        </div>
    );
};

export default PlateGenerate;
